(function($){
  $.fn.selectbox = function() {
    return this.each(function(){
      var $el = $(this),
          val = $el.find(':selected').text(),
          $text;

      // Build Elements
      $el.wrap('<div class="select-wrapper '+ $el.attr('class') +'"></div>');
      $('<span>'+ val +'</span><i class="icon-caret-down"></i>').insertBefore( $el );
      $text = $el.prevAll('span');

      // onChange Event
      $el.live('change', function(){ 
        $text.text( $el.find(':selected').text() );
      });

    });
  };
})(jQuery);

